export function listPlaylists(playlists) {
	return {
		type: 'LIST_PLAYLISTS',
		playlists: playlists
	};
}

export function searchPlaylists(playlists) {
	return {
		type: 'SEARCH_PLAYLISTS',
		playlists: playlists
	};
}

export function filterPlaylists(playlists) {
	return {
		type: 'FILTER_PLAYLISTS',
		playlists: playlists
	};
}

export function isFilteredPlaylists(isFiltered) {
	return {
		type: 'IS_FILTERED_PLAYLISTS',
		isFiltered: isFiltered
	};
}
